window.bookSummaryJSON = "<p><b>A thrilling new novel based on the Paramount+ TV series </b><b><i>Star Trek: Strange New Worlds</i></b><b>!</b><br> <br> While patrolling the borders of the Klingon Empire, Captain Christopher Pike and the crew of the USS <i>Enterprise</i> record a series of subspace echoes from a planet orbiting a volatile flare star—and when Lieutenant Spock and Commander Una Chin-Riley lead a landing party to learn more, they discover the ruins of a dead civilization and evidence of starship-grade metals…quite possibly a crash site.<br> <br> As they continue to investigate the strange signals, Spock and Una find shocking signs of dangerous alien life and remnants of what can only be Federation hardware. The trail soon leads Pike and<i> Enterprise’</i>s helmswoman Lieutenant Erica Ortegas deep into the mystery of a lost Starfleet vessel, missing in action for over ninety years—and to a terrible dilemma that will challenge the crew to question their past...and their future.</p>"; 
